style.css:
@-moz-document domain("lichess.org") {
/* Lines */
    line[stroke="#15781B"]{
        stroke: #302218;
        opacity: 0.6 
    }
    line[stroke="#882020"]{
        stroke: #302218;
        opacity: 0.6 
    }
    line[stroke="#003088"]{
        stroke: #302218;
        opacity: 0.6 
    }
    line[stroke="#e68f00"]{
        stroke: #302218;
        opacity: 0.6 
    }
    /* Paths */
    path[fill="#15781B"]{
        fill: #302218;
    }
    path[fill="#882020"]{
        fill: #302218;
    }
    path[fill="#003088"]{
        fill: #302218;
    }
    path[fill="#e68f00"]{
        fill: #302218;
    }
    square.last-move {
        will-change: transform;
        /*background-color: rgba(203, 143, 66, .41);*/
        background-color: rgba(191, 129, 29, .41)
    }
    square.selected {
        background-color: rgba(203, 143, 66, .5) 
    }
    square.move-dest {
        background: radial-gradient(rgba(48, 34, 24, 0.5) 19%, rgba(48, 34, 24, 0) 20%);
        pointer-events: auto 
    }
    square.move-dest:hover {
        background: rgba(48, 34, 24, 0.5);
    }
    square.oc.move-dest {
        background: radial-gradient(transparent 0%, transparent 79%, rgba(48, 34, 24, 0.5) 80%);
    }
    square.current-premove {
        background-color: rgba(48, 34, 24, .3) !important 
    }
    square.premove-dest {
        background: radial-gradient(rgba(48, 34, 24, .3) 19%, rgba(0, 0, 0, 0) 20%);
        pointer-events: auto;
    }
    square.premove-dest:hover {
        background: rgba(48, 34, 24, .3);
    }
    square.oc.premove-dest {
        background: radial-gradient(transparent 0%, transparent 79%, rgba(48, 34, 24, .3) 80%);
    }
    square.check {
        background: radial-gradient(ellipse at center, rgba(255, 0, 0, .6) 0%, rgba(231, 0, 0, .6) 25%, rgba(169, 0, 0, 0) 89%, rgba(158, 0, 0, 0) 100%);
    }
    /* Black Pieces */
    .is2d .black.pawn {
        background-image: url(https://images.chesscomfiles.com/chess-themes/pieces/neo_wood/150/bp.png);
    }
    .is2d .black.knight {
        background-image: url(https://images.chesscomfiles.com/chess-themes/pieces/neo_wood/150/bn.png);
    }
    .is2d .black.bishop {
        background-image: url(https://images.chesscomfiles.com/chess-themes/pieces/neo_wood/150/bb.png);
    }
    .is2d .black.rook {
        background-image: url(https://images.chesscomfiles.com/chess-themes/pieces/neo_wood/150/br.png);
    }
    .is2d .black.queen {
        background-image: url(https://images.chesscomfiles.com/chess-themes/pieces/neo_wood/150/bq.png);
    }
    .is2d .black.king {
        background-image: url(https://images.chesscomfiles.com/chess-themes/pieces/neo_wood/150/bk.png);
    }
    /* White Pieces */
    .is2d .white.pawn {
        background-image: url(https://images.chesscomfiles.com/chess-themes/pieces/neo_wood/150/wp.png);
    }
    .is2d .white.knight {
        background-image: url(https://images.chesscomfiles.com/chess-themes/pieces/neo_wood/150/wn.png);
    }
    .is2d .white.bishop {
        background-image: url(https://images.chesscomfiles.com/chess-themes/pieces/neo_wood/150/wb.png);
    }
    .is2d .white.rook {
        background-image: url(https://images.chesscomfiles.com/chess-themes/pieces/neo_wood/150/wr.png);
    }
    .is2d .white.queen {
        background-image: url(https://images.chesscomfiles.com/chess-themes/pieces/neo_wood/150/wq.png);
    }
    .is2d .white.king {
        background-image: url(https://images.chesscomfiles.com/chess-themes/pieces/neo_wood/150/wk.png);
    }
    /* Background */
    html.transp::before{
        background-image:url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAAANSURBVBhXYzDQ0/4PAAKkAYnlUA6qAAAAAElFTkSuQmCC") 
    }
    /* Board */
    .is2d cg-board::before {
        background-image: url(https://images.chesscomfiles.com/chess-themes/boards/walnut/200.png) !important;
    }
    /* Ranks and Files */
    .is2d coords {
        ---cg-ccw: #c5ab8a !important;
        ---cg-ccb: #644731 !important 
    }
}
